(function () {
    window.handwritten = {
        start: function (autostop, wrapper) {
            console.log('start handwritten');



            /**
             * .
             */
            Date.prototype.format = function (fmt) {
                var o = {
                    "M+": this.getMonth() + 1, //
                    "d+": this.getDate(), //
                    "h+": this.getHours(), //
                    "m+": this.getMinutes(), //
                    "s+": this.getSeconds(), //
                    "q+": Math.floor((this.getMonth() + 3) / 3), //
                    "S": this.getMilliseconds() //
                };
                if (/(y+)/.test(fmt)) {
                    fmt = fmt.replace(RegExp.$1, (this.getFullYear() + "").substr(4 - RegExp.$1.length));
                }
                for (var k in o) {
                    if (new RegExp("(" + k + ")").test(fmt)) {
                        fmt = fmt.replace(RegExp.$1, (RegExp.$1.length == 1) ?
                            (o[k]) : (("00" + o[k]).substr(("" + o[k]).length)));
                    }
                }
                return fmt;
            }

            /**
             * URL
             */
            function getQueryString(name) {
                var reg = new RegExp("(^|&)" + name + "=([^&]*)(&|$)", "i");
                var r = window.location.search.substr(1).match(reg);
                if (r != null) return unescape(r[2]); return null;
            }
            /**
            * 
            */
            function isNumeric(n) {
                return !isNaN(parseFloat(n)) && isFinite(n);
            }

            function myRedirect(nextw) {
                event.returnValue = false;//
                this.location.href = nextw;
            }
            //touchmove
            document.body.addEventListener('touchmove', function (e) {
                e.preventDefault(); //()
            }, { passive: false }); //passive iosandroid 


            new lineCanvas({
                el: document.getElementById("canvas"), //canvasdiv
                clearEl: document.getElementById("clearCanvas"), //
                saveEl: document.getElementById("saveCanvas"), //
                //      linewidth:1,//
                //      color:"black",//
                //      background:"#ffffff"//
            });

            function lineCanvas(obj) {
                this.linewidth = 1;
                this.color = "#000000";
                this.background = "#ffffff";
                for (var i in obj) {
                    this[i] = obj[i];
                };
                this.canvas = document.createElement("canvas");
                this.el.appendChild(this.canvas);
                this.cxt = this.canvas.getContext("2d");
                this.canvas.width = this.el.clientWidth;
                this.canvas.height = this.el.clientHeight;

                this.cxt.fillStyle = this.background;
                this.cxt.fillRect(0, 0, this.canvas.width, this.canvas.height);

                //this.cxt.fillStyle = "red";
                //this.cxt.font = "16px verdana";
                //this.cxt.textAlign = "left";

                ////fillText("",x0y0)
                //var orderedtime = new Date().getTime();
                //orderedtime = (new Date(orderedtime)).format("yyyy-MM-dd  hh:mm");
                //this.cxt.fillText(orderedtime, 30, 30);

                this.cxt.fillStyle = this.background;
                this.cxt.strokeStyle = this.color;
                this.cxt.lineWidth = this.linewidth;
                this.cxt.lineCap = "round";
                //
                this.canvas.addEventListener("touchstart", function (e) {
                    this.cxt.beginPath();
                    this.cxt.moveTo(e.changedTouches[0].pageX, e.changedTouches[0].pageY);
                }.bind(this), false);
                //
                this.canvas.addEventListener("touchmove", function (e) {
                    this.cxt.lineTo(e.changedTouches[0].pageX, e.changedTouches[0].pageY);
                    this.cxt.stroke();
                }.bind(this), false);
                //
                this.canvas.addEventListener("touchend", function () {
                    this.cxt.closePath();
                }.bind(this), false);
                //
                this.clearEl.addEventListener("click", function () {
                    this.cxt.clearRect(0, 0, this.canvas.width, this.canvas.height);
                }.bind(this), false);
                //base64
                this.saveEl.addEventListener("click", function () {
                    var imgBase64 = this.canvas.toDataURL();
                    //console.log(imgBase64);
                    return wrapper.invokeMethodAsync("invokeFromJS", imgBase64);
                }.bind(this), false);
                //
                function adddatetime() {
                    this.cxt.fillStyle = "red";
                    this.cxt.font = "12px ''";
                    this.cxt.textAlign = "left";
                    //fillText("",x0y0)
                    var orderedtime = new Date().getTime();
                    orderedtime = (new Date(orderedtime)).format("yyyy-MM-dd  hh:mm");
                    this.cxt.strokeText(orderedtime, 50, 100);
                }
            };


        }
    };
})();
